// SPDX-License-Identifier: MIT
pragma solidity ^0.6.12;

import "./LnAdmin.sol";

contract LnFeeSystem is LnAdmin {

    address public constant FEE_DUMMY_ADDRESS = address(0x2048);

    constructor(address _admin ) public LnAdmin(_admin ) {
    }

    function addExchangeFee( uint feeUsd ) public {
        emit ExchangeFee( feeUsd );
    }

    event ExchangeFee( uint feeUsd );

    function feePeriodDuration() external pure returns (uint) {
        return 0;
    }
    function recentFeePeriods(uint index)
        external
        pure
        returns (
            uint64 feePeriodId,
            uint64 startingDebtIndex,
            uint64 startTime,
            uint feesToDistribute,
            uint feesClaimed,
            uint rewardsToDistribute,
            uint rewardsClaimed
        )
    {
        return (0,0,0,0,0,0,0);
    }

    function isFeesClaimable(address account) external view returns (bool feesClaimable) {
        feesClaimable = false;
    }
    // total fee and total reward
    function feesAvailable(address account) public view returns (uint, uint) {
        return (0,0);
    }
    // claim fee and reward.
    function claimFees() external returns (bool) {
        return false;
    }
}
